import React from 'react';
import { Cell, Grid } from 'react-mdl';

function ContactMe() {
    return (
        <Grid id="contactMe-grid">
            <Cell col={ 6 }>
                <h2>Paul Rosero</h2>
                <img src="/images/ProfilePicture.png" alt="avatar" className="avatar-img"/>
            </Cell>
            <Cell col={ 6 }>
            <h1>other side</h1>
            </Cell>
        </Grid>
    )
}

export default ContactMe;
